import React from "react";

import { Container } from "@material-ui/core";

import TodoCard from "./TodoCard";
import { ResponseTodoType } from "../../types/types";

type PropsType = {
  completedTodos: ResponseTodoType[];
  isFetchingCompletedTodos: boolean;
};

function CompletedTodos(props: PropsType) {
  const { completedTodos, isFetchingCompletedTodos } = props;

  return (
    <section>
      <Container>
        <TodoCard
          title="Mern Stack Todo App"
          description="Complete this project as soon as possible."
          isDeleting={false}
          isMarkingAsCompleted={false}
          deleteHandler={() => {}}
          markAsCompletedHandler={() => {}}
          isCompleted={true}
        />
      </Container>
    </section>
  );
}

export default CompletedTodos;
